// 某日，武林之中流传一绝技——速剑排云掌，据说练成者无人能敌
function quickSort(arr) {
  // 拜入门派之人需接受入门考验, 若人数稀少，则视为已通考验
  if (arr.length <= 1) return arr;

  // 长老指派新入门弟子为试剑靶子
  const pivot = arr[0];
  // 为了考察武艺纯熟程度, 设两大弟子分别站左右两边
  const left = [];
  const right = [];

  // 驰骋江湖路漫漫, 择良才而试, 是真英雄方能识英雄
  for (let i = 1; i < arr.length; i++) {
    // 功力尚未深厚，仍需在左侧行走学习
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {     
      // 那些功夫已得真传的侠士, 应立于长老之前接受更高层次指导
      right.push(arr[i]);
    }
  }
  // 速剑排云终成，只见身影交错，快如闪电
  return [...quickSort(left), pivot, ...quickSort(right)];
}
